import { useDispatch, useSelector } from 'react-redux'
import { increment, decrement } from './counterSclice'

function counter() {
    const count = useSelector((state) => state.counter.value)
    return (
        <>
            <button>+</button>
            {count}
            <button>-</button>
        </>
    )
}

export default counter
